import React from 'react';
import chatApp from '../images/mobile.gif'

const Projects = () => {
     return (
          <div className="">
               <div className="grid h-screen place-items-center">
                    <div class="flex justify-center">
                         <div class="flex flex-col md:flex-row md:max-w-xl rounded-lg bg-white shadow-lg">
                              <img class=" w-full h-96 md:h-auto object-cover md:w-48 rounded-t-lg md:rounded-none md:rounded-l-lg"
                                   src={chatApp}
                                   alt=""/>
                              <div class="p-6 flex flex-col justify-start">
                                   <h5 class="text-gray-900 text-xl font-medium mb-2">Real-Time Chat App</h5>
                                   <p class="text-gray-700 text-base mb-4">
                                        <li></li>
                                   </p>
                                   <p class="text-gray-600 text-xs">Last updated 3 mins ago</p>
                              </div>
                         </div>
                    </div>
               </div>

          </div>
     );
}

export default Projects;
